import React from "react";

function BookList({ books, deleteBook }) {
    return (
        <ul>
            {books.map((book) => (
                <li key={book.bookNumber}>
                    {book.title} by {book.author} - ${book.price}
                    <button onClick={() => deleteBook(book.bookNumber)}>Delete</button>
                </li>
            ))}
        </ul>
    );
}

export default BookList;
